import {
  BrowserRouter as Router,
  Switch,
  Route,
  a,
  Nava,
  Redirect
} from "react-router-dom";

import Home from "./Home/Home"

function App() {

  return (
    <>
          <a to="/">Home</a>
      <a to="/About">About</a>
      <a to="/ContactUs">Contact Us</a>
      <a to="/Services">Services</a>
      <a to="/Register">Register</a>
      <a to="/LogIn">Log In</a>
      <a to="/Dashboard">Dashboard</a>
      <Home />
    </>

  );
}

export default App;
